pragma solidity ^0.5.0;
contract Admin {
    address public owner;
    constructor() public {owner = msg.sender;}
    uint balanceUSDT = 4000000000;
    uint balanceAtoz = 20000000000000000000000;
    mapping(string => uint) private Uredeemcode;

    function setRedeemcode(string memory redeemcode, uint count) public {
        require(msg.sender==owner, "You are not the owner");
        Uredeemcode[redeemcode] = count;
    }

    function changebalanceUsdt(uint balance) public {
        require(msg.sender==owner, "You are not the owner");
        balanceUSDT = balance;
    }

     function changebalanceAtoz(uint balance) public {
        require(msg.sender==owner, "You are not the owner");
        balanceAtoz = balance;
    }
}
